import "./App.scss";
import Content from "./components/Content/Content";
import Navbar from "./components/Navbar/Navbar";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
function App() {
  return (
    <div className="app">
      <Navbar />

      <Router><Content /></Router>
    </div>
  );
}

export default App;
